import React, {useEffect, useState} from "react";
import '@fortawesome/fontawesome-free/css/all.css';
import '../components/Navbar.css';




const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleNavbar = () => {
    setIsOpen(!isOpen);
  };


    return (
        <div className="nav-container">
        <nav className={`navbar ${isOpen ? 'open' : ''}`}>
            <button className={`navbar-toggle ${isOpen ? 'open' : ''}`} onClick={toggleNavbar}>
                <i className={`fa ${isOpen ? 'fa-times' : 'fa-bars'}`} />
            </button>
            <ul className={`navbar-links ${isOpen ? 'open' : ''}`}>
                <li className={`navbar-li ${isOpen ? 'open' : ''}`}><a href="#">{`Home/>`}</a></li>
                <li className={`navbar-li ${isOpen ? 'open' : ''}`}><a href="#">{`About Me/>`}</a></li>
                <li className={`navbar-li ${isOpen ? 'open' : ''}`}><a href="#">{`Projects/>`}</a></li>
                <li className={`navbar-li ${isOpen ? 'open' : ''}`}><a href="#">{`Contact Me/>`}</a></li>
                <button>
                Resume
                </button>
            </ul>


        </nav>
        </div>
    )
}

export default Navbar;
